Algebraic A tangle build from $\vee$ and $+$ on some rational tangles. $$\LP\color{var(--r-Purple)}\LB3\ 2\ 3\RB+\LB3\ 2\ 3\RB\color{var(--r-Foreground)}\RP\vee\LP\color{var(--r-Purple)}\LB3\ 2\ 3\RB+\LB3\ 2\ 3\RB\color{var(--r-Foreground)}\RP$$ But actually arborescent Arborescent knots (and tangles) are constructed by taking a collection of twisted bands described by a weighted tree and connecting them with successive plumbing.
It&rsquo;s straight forward to see (you should see in the example) that algebraic and arborescent constructions describe the same class of object.
