The tooling used to generate this visualization was built as a one off for a topics course, as such I wouldn&rsquo;t call it alpha it&rsquo;s currently a toy proof of concept. That said, the tool is built to support any knot. Unfortunately, right now the knot needs to be defined at compile time (this can be changed in the future if needed/wanted). If you would like another knot or a published (polished FOSS) version of the software let me know.
Instructions Movement: W - forward A - left S - backward D - right Space - up Shift - down Look around with mouse pointer Note: for some reason the version here spawns the user looking away from the origin. Look around and you&rsquo;ll find the knot. The Visualization
